script: |
  super -f text -I q323.spq | sort > q323.out

inputs:
  - name: q323.spq
    data: |
      SELECT ALL - col0 FROM tab2 (FORMAT parquet) cor0 WHERE NOT + 0 BETWEEN + - ( + - col0 ) + + ( - 80 ) AND + CAST ( CAST ( col1 AS INTEGER ) AS INTEGER ) * col0;
  - name: tab2

outputs:
  - name: q323.out
    data: |
